import React, { useState, useEffect, PropTypes  } from "react";
import {Routes, Route} from 'react-router';
import { withRouter, Redirect, BrowserRouter, Router } from "react-router-dom";
import { connect } from "react-redux";


import Button from '@material-ui/core/Button';
import './App.css';
import WeatherSummary from './WeatherSummary.js';
import ResponsiveAppBar from "./ResponsiveAppBar.js";
import ProductDisplay from "./ProductDisplay";
import Feature from "./Feature";
import AuthForm from "./AuthForm";
import { authUser } from "./store/actions/auth.js";


//import './css/login.css';





const App = props => {
  const { authUser } = props;



  return (
<div>
<ResponsiveAppBar/>
<Routes>
{/* Right now I added a props field to pricing, I need to create it such that upong successful login, getting 
redirected to a different page. This is the precursor to displaying a different UI based off if you're 
an admin or regular user.  */}
<Route path="Pricing" 
          element={
             <AuthForm
            onAuth={authUser}
            buttonText="Log in"
            heading="Welcome Back." /> }
        />
</Routes>
<ProductDisplay />
<Feature />


</div>
  );
}

function mapStateToProps(state) {
  return {
    errors: state.errors
  };
}

//export default App;
export default connect(mapStateToProps, { authUser })(App);
